import{_ as i,o as a,c as o,z as e,a as t}from"./chunks/framework.9482e208.js";const C=JSON.parse('{"title":"§ 59.1-92.5 Filing of applications.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-92.5.md","filePath":"vacode/59.1-92.5.md"}'),n={name:"vacode/59.1-92.5.md"},s=e("h1",{id:"§-59-1-92-5-filing-of-applications",tabindex:"-1"},[t("§ 59.1-92.5 Filing of applications. "),e("a",{class:"header-anchor",href:"#§-59-1-92-5-filing-of-applications","aria-label":'Permalink to "§ 59.1-92.5 Filing of applications."'},"​")],-1),r=e("p",null,"A. Upon the filing of an application for registration and payment of the application fee, the Commission shall cause the application to be examined for conformity with this chapter.",-1),l=e("p",null,"B. The applicant shall provide any additional relevant information requested by the Commission, including a description of a design mark, and may make, or authorize the Commission to make, such amendments to the application as may be reasonably requested by the Commission or deemed by the applicant to be advisable to respond to any rejection or objection.",-1),p=e("p",null,"C. The Commission may require the applicant to disclaim any unregistrable component of a mark otherwise registrable, and an applicant may voluntarily disclaim any component of a mark sought to be registered. No disclaimer shall prejudice or affect the applicant's or registrant's common law rights then existing or thereafter arising in the disclaimed matter, or the applicant's or registrant's rights of registration on another application if the disclaimed matter is or has become distinctive of the applicant's or registrant's goods or services.",-1),c=e("p",null,"D. Amendments to the application may be made by the Commission with the applicant's consent.",-1),h=e("p",null,"E. If the applicant is found not to be entitled to registration, the Commission shall notify the applicant thereof in writing and of the reasons therefor. The applicant shall have ninety days from the date of the Commission's notice to make a bona fide reply, or to amend the application, in which event the application shall then be reexamined. This procedure may be repeated until (i) the Commission finally refuses registration of the mark or (ii) the applicant fails to reply or amend within the specified period, whereupon the request for registration shall be deemed to have been finally refused.",-1),d=e("p",null,[t("1998, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0819",target:"_blank",rel:"noreferrer"},"819"),t(".")],-1),m=[s,r,l,p,c,h,d];function f(g,_,u,b,y,v){return a(),o("div",null,m)}const x=i(n,[["render",f]]);export{C as __pageData,x as default};
